interface CreateUserPageProps {
  expressApi: ExpressAPI;
}

export const CreateUserPage: FC<CreateUserPageProps> = ({ expressApi }) => {
  return (
    <MainLayout>
      <RegisterForm api={ expressApi } /> 
    </MainLayout>
  )
};
